class Solution:
    def countNegatives(self, grid: List[List[int]]) -> int:
        m = len(grid)
        n = len(grid[0])
        cnt = 0
        for i in range(m):
            if grid[i][0] < 0:
                break
            for j in range(n):
                if grid[i][j] >= 0:
                    cnt += 1
                else:
                    break
        return m * n - cnt

    def maxEvents(self, events: List[List[int]]) -> int:
        i = 1
        ans = 0
        end = max(events,key=lambda x:x[1])[1]
        events.sort(key=lambda x:x[1])
        while i <= end:
            events = list(filter(lambda x:x[1] >= i, events))
            for e in events:
                if e[0] <= i:
                    ans += 1
                    events.remove(e)
                    break
            if len(events) == 0:
                return ans
            ne = min(events, key=lambda x: x[0])[0]
            i = max(i+1,ne)

        return ans

    def isPossible(self, target: List[int]) -> bool:
        target.sort()
        n = len(target)
        diff = [target[i]-target[i-1] for i in range(1,n)]
        if sum(diff) == 0 and target[0] > 1:
            return False
        for d in diff:
            if d % (n-1) > 0:
                return False
        return True

