class ProductOfNumbers:

    def __init__(self):
        self.arr = [1]
        self.last_index = [-1]
        self.local_product = [1]

    def add(self, num: int) -> None:
        n = len(self.arr)
        if num == 0:
            self.last_index.append(n)
            self.local_product.append(0)
        else:
            self.last_index.append(self.last_index[-1])
            last_product = self.local_product[-1]
            if last_product == 0:
                self.local_product.append(num)
            else:
                self.local_product.append(last_product * num)
        self.arr.append(num)

    def getProduct(self, k: int) -> int:
        n = len(self.arr)
        lastzero = self.last_index[-1]
        if lastzero + k < n:
            prev = self.local_product[-k-1]
            if prev == 0:
                return self.local_product[-1]
            return self.local_product[-1] // prev
        else:
            return 0

